import styled from "@emotion/styled";
import { Button } from "@mui/material";
import { Colors } from ".";



export const AddPlayerButton = styled((Button) => ({
    color: Colors.primary,
    backgroundColor: Colors.secondary,
    borderRadius: "15px",
    "&:hover": {
        background: Colors.dark
    }
}))
